import styles from "../assets/NavBarMenu.module.css";
import { Link } from "react-router-dom";

function NavBarMenu() {
  function handleClick() {
    console.log("Hola!!!!!!!!!!!!!!");
    //var x = document.getElementById("navBarContainer");
    //console.log(x);
  }

  return (
    <li className={styles.navBarContainer} id="navBarContainer">
      <Link to="/">
        <p>Home</p>
      </Link>
      <Link to="/shows">
        <p>Shows</p>
      </Link>
      <Link to="/contact">
        <p>Contact</p>
      </Link>
      <Link to="/about">
        <p>About</p>
      </Link>
      <a
        href="javascript:void(0);"
        className={styles.icon}
        open={open} handleClick={handleClick}
      >
        <i class="fa fa-bars"></i>
      </a>
    </li>
  );
}

export default NavBarMenu;
